import React, {Component} from 'react';
import { Link } from 'react-router-dom';
//import { Link } from 'react-router-dom';

class Header extends Component {
  render() {
    return (
      <div className="row mb-5 align-items-center">
        <div className="col-md-12 col-lg-6 mb-4 mb-lg-0">
          <h2>React News App</h2>
          <p className="mb-0">Developed by Olaoye Anthony Somide</p>
        </div>

        <div className="col-md-12 col-lg-6 text-left text-lg-right">
          <div id="filters" className="filters">
            <Link to="/" className="active">All</Link>
            //<a href="./" className="active">All</a>
            <a href="./politics" >Politics</a>
            <a href="./business" >Business</a>
            <a href="./sports" >Sports</a>
            <a href="./cryptos" >Cryptos</a>
          </div>
        </div>
      </div>
    );
  }

}

export default Header;
